import React from 'react';
import './MarketingAndSales.css';

const MarketingAndSales = () => {
  return (
    <div className="marketing-sales-page">
      <header className="page-header">
        <h1>Sales & Marketing</h1>
        <p>Boost your brand and drive conversions with our sales and marketing services.</p>
      </header>

      <section className="section-card">
        <h2>Marketing Services</h2>
        <p>
          Our marketing strategies are tailored to elevate your brand, expand your reach, and increase ROI.
          We offer SEO, social media management, PPC campaigns, and content marketing.
        </p>
      </section>

      <section className="section-card">
        <h2>Sales Services</h2>
        <p>
          We provide data-driven sales solutions including CRM setup, lead generation, sales funnel optimization,
          and outbound outreach campaigns to close more deals effectively.
        </p>
      </section>
    </div>
  );
};

export default MarketingAndSales;
